import React from "react";
import { useDispatch, useSelector } from "react-redux";
import simpledata from './reducers/simpledata';

const List = () => {

    const alldata = useSelector(data => data.Alldata);

    console.log(alldata);
    const dispatch = useDispatch();

    return (
        <>
            <table border={1}>
                <tr>
                    <td>Name</td>
                    <td>Email</td>
                    <td>Phone</td>
                </tr>



            </table>
        </>
    )
}

export default List;
